  \"coyote-diet-research-at-carolina-sandhills-national-wildlife-refuge-annual-reports-2010-20\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"We wanted to  determine primary food items
  of coyotes in the state. Our long term goal is to assess whether coyotes could impact
  key species of concern at Carolina Sandhills National Wildlife Refuge such as white-tailed
  deer (Odocoileus virginianus) and wild turkey (Meleagris gallopavo).  Scat was collected
  twice weekly from two locations at Carolina Sandhills, Oxpen and Dove Field, and
  each location occupies both the predator and prey populations of interest.  Scat
  was first identified as coyote scat based on shape and size.\",\n\t\"license_title\":
